import React, { useEffect } from 'react';

const Userdata = () => {
  const x = 'https://jsonplaceholder.typicode.com/users';
  const User = async (x) => {
    try {
      const fetchData = await fetch(x);
      const res = await fetchData.json();
      console.log(res);
    } catch (e) {
      console.error(e);
    }
  };

  useEffect(() => {
    User(x);
  });
  return <div>Userdata</div>;
};

export default Userdata;
